import React, { createRef } from "react";
import { useState } from "react";
import {useForm} from "react-hook-form";
function Register()
{
    const [state,setState]=useState({name:"",email:"",password:""});


    const fullName=createRef(null);
    const { register, handleSubmit, watch, formState: { errors } } = useForm();
  const onSubmit = (e) => 
  {e.preventDefault();
    setState({name:"",email:"",password:"sssss"})
  };
    return (<>

    <main className="form-signin">
    <form onSubmit={onSubmit}>
      <img className="mb-4" src="/docs/5.1/assets/brand/bootstrap-logo.svg" alt="" width="72" height="57"/>
      <h1 className="h3 mb-3 fw-normal">Sign Up</h1>

      <div className="form-floating">
        <input ref={fullName} {...register('fullname',{maxLength:15,minLength:3})} className="form-control" id="floatingPassword" placeholder="Name" onChange={(e)=>{setState({...state,name:e.target.value}); console.log(state);}}/>
        <label for="floatingPassword">Name</label>
      </div>
      <div className="form-floating">
        <input  type="email" {...register("email",{pattern:{value:"^([a-z]){1,}@([a-z]){3,8}(\.)([a-z]){3,5}$",message:"email"}})}className="form-control" id="floatingInput" placeholder="name@example.com"/>
        <label for="floatingInput">Email address</label>
      </div>
      <div className="form-floating">
        <input type="password"  {...register("password",{required:true,pattern:"^[a-zA-z]+$/i"})} className="form-control" id="floatingPassword" placeholder="Password"/>
        <label for="floatingPassword">Password</label>
      </div>




      <button onClick={onSubmit} className="w-100 btn btn-lg btn-primary" type="submit">Sign in</button>
      <p className="mt-5 mb-3 text-muted">© 2017–2021</p>
    </form>
  </main>

    </>);
} 

export default Register;
